import React from "react";

const ExpenseForm = () => {

    const Add = () => {
        let name = document.getElementById('ExpenseDate').value;
        console.log(name.value.getFullYear());
    }

    return(
        <div>
            <input type="text" id="ExpenseTitle"/>
            <input type="text" id="ExpenseAmount"/>
            <input type="Date" id="ExpenseDate"/>
            <button onClick = {Add} >Add</button>
        </div>
    )

}

export default ExpenseForm;
